{
 QueryNode_Free((yypminor->yy131)); 
}
      break;
    case 43: /* attribute */
{
 rm_free((char*)(yypminor->yy55).value); 
}
      break;
    case 44: /* attribute_list */
{
 array_free_ex((yypminor->yy105), rm_free((char*)((QueryAttribute*)ptr )->value)); 
}
      break;
    case 56: /* geo_filter */
