      case 12: /* expr ::= union */ yytestcase(yyruleno==12);
      case 17: /* text_expr ::= text_union */ yytestcase(yyruleno==17);
      case 92: /* vector_query ::= vector_command */ yytestcase(yyruleno==92);
{
  yylhsminor.yy131 = yymsp[0].minor.yy131;
}
