  yymsp[-2].minor.yy131 = yylhsminor.yy131;
        break;
      case 103: /* num ::= SIZE */
      case 106: /* num ::= NUMBER */ yytestcase(yyruleno==106);
{
  yylhsminor.yy59.num = yymsp[0].minor.yy0.numval;
  yylhsminor.yy59.inclusive = 1;
}
  yymsp[0].minor.yy59 = yylhsminor.yy59;
        break;
